import React from 'react';
import styled from 'styled-components';

const Warpper = styled.div``;

const Date = styled.h1`
  color: var(--color-main);
  width: 13rem;
  height: 4rem;
  border: 1px solid;
  border-radius: 100%;
  text-align: center;
`;

export default function Intro() {
  return (
    <div>
      <Warpper>
        <Date>2024 04 28</Date>
      </Warpper>
    </div>
  );
}
